import "./style.scss";
import { NavLink } from "react-router-dom";
import { logout, EditedNameFalse } from "../../feature/loginSlice";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircleUser, faSignOut } from "@fortawesome/free-solid-svg-icons";
import { useSelector, useDispatch } from "react-redux";

const SignOut = () => {
  const firstName = useSelector((state) => state.login.firstName);
  const dispatch = useDispatch();

  const onLogout = () => {
    dispatch(logout());
  };
  return (
    <div className="main-nav-items">
      <NavLink to="/profile" onClick={EditedNameFalse}>
        <FontAwesomeIcon
          icon={faCircleUser}
          className="main-nav-item-icon icon-user"
        />
        {firstName}
      </NavLink>

      <NavLink onClick={onLogout} to="/login">
        <FontAwesomeIcon icon={faSignOut} className="main-nav-item-icon" />
        <span>Sign Out</span>
      </NavLink>
    </div>
  );
};

export default SignOut;
